import java.util.List;

class Solution {
    public int minOperations(List<Integer> nums, int k) {
        boolean[] found = new boolean[k]; // Track if elements 1 to k are found.
        int count = 0; // Count of unique elements from 1 to k found.
        int operations = 0;

        for (int i = nums.size() - 1; i >= 0; i--) {
            int num = nums.get(i);
            // Check if the number is within the range 1 to k and not already found.
            if (num <= k && !found[num - 1]) {
                found[num - 1] = true; // Mark as found.
                count++; // Increase the count of found elements.
            }
            operations++; // Increase the operations count for each removal.
            if (count == k) { // If all elements from 1 to k are found.
                return operations; // Return the operations needed.
            }
        }

        // Given the problem guarantees a solution, this line is never expected to be reached.
        return operations;
    }
}
